/*!
 * load the image to the center of the screen.
 *
 * @param   addr memory address where to load the image   
 * @param   panel ipu panel configuration data structure
 */
void load_centralized_image(uint32_t addr, ips_dev_panel_t * panel)
{
    /*the image is a 313*117 freescale logo */
    int screenwidth = panel->width;
    int screenheight = panel->height;
    int width = 313, height = 117;
    int left_offset = (screenwidth - width) / 2;
    int top_offset = (screenheight - height) / 2;
    int i = 0;

    memset((void *)addr, 0x1F, 2 * screenheight * screenwidth);
    for (i = 0; i < height; i++) {
        memcpy((void *)(addr + screenwidth * (top_offset + i) * 2 + left_offset * 2),
               &gImage_fsl[width * i * 2], width * 2);
    }
}

void load_foreground_image(uint32_t addr, uint32_t width, uint32_t height)
{
    memcpy((void *)addr, gImage_foretext, width * height * 2);
}

void load_horiz_image(uint32_t addr, uint32_t width, uint32_t height)
{
    uint32_t i;
    uint16_t *RGB_pointer = (void *)addr;
    uint16_t red = 0xF800, green = 0x07E0, blue = 0x001F;

    for (i = 0; i < width * height / 3; i++)
        memcpy(RGB_pointer++, &red, 2);
    for (i = 0; i < width * height / 3; i++)
        memcpy(RGB_pointer++, &green, 2);
    for (i = 0; i < width * height / 3; i++)
        memcpy(RGB_pointer++, &blue, 2);

/*    uint32_t segment = width * height / 2;
    memset((void *)addr, 0xFA, segment);
    memset((void *)addr + segment, 0x1F, segment);
    memset((void *)addr + 2 * segment, 0xAF, segment);
    memset((void *)addr + 3 * segment, 0xCC, segment);
*/
}

void set_background_margin(ips_dev_panel_t * panel, uint32_t width, uint32_t height)
{
    /*the image is a 313*117 freescale logo */
    uint32_t screenwidth = panel->width;
    uint32_t screenheight = panel->height;
    uint32_t left_offset = (screenwidth - width) / 2;
    uint32_t i = 0;

    for (i = 0; i < screenheight; i++) {
        memset((void *)(CH23_EBA0 + screenwidth * i * 2), 0x00, left_offset * 2);
        memset((void *)(CH23_EBA0 + screenwidth * i * 2 + (width + left_offset) * 2), 0x00,
               left_offset * 2);
    }
}

void load_vert_image(uint32_t addr, uint32_t width, uint32_t height)
{
    uint32_t i = 0;

    for (i = 0; i < height; i++) {
        memset((void *)(addr + i * width * 2), 0xFA, width / 2);
        memset((void *)(addr + i * width * 2 + width / 2), 0x00, width / 2);
        memset((void *)(addr + i * width * 2 + width), 0xAF, width / 2);
        memset((void *)(addr + i * width * 2 + 3 * width / 2), 0xCC, width / 2);
    }
}
